import React from "react";
import { useState } from "react";
import ReactDOM from "react-dom";
import mountNode from "react-router-dom";
import { BrowserRouter as Router, Link, Route, Switch } from "react-router-dom";
import Loginup from "./login_up.js";
import "../css/Header&Footer.css";
import "../css/creativeLinkEffects.css";
import ShoppingCart from "./shoppingCart";
import PinkLogo from "../Pictures/PinkLogo.svg";
import Main from "./Main";
import "../css/search_1.scss";

import { DownloadOutlined } from "@ant-design/icons";
import { BsHeart } from "react-icons/bs";
import "antd/dist/antd.css";

function MyHeader(props) {
  function onClickChangeColor() {
    var someElement = document.getElementsByClassName("btnmyheaderPink");

    someElement.className += " btnmyheaderBlue"; //add "newclass" to element (space in front is important)
    // someElement.className -= "btnmyheaderPink";
    // const [btnmyheaderPink, setToggleClass] = useState(false);

    // $(".btnmyheaderPink").toggleClass("btnmyheaderBlue");
    // toggleClass ? "btnmyheaderPink" : "btnmyheadeBlue";
    // element.className.add("btnmyheaderBlue");
    // element.className.remove("btnmyheaderPink");
    // setcolor("blue");
  }

  return (
    <div className="bodyheader">
      <Router className="btnmyheaderPink">
        {" "}
        <Link to="/ShoppingCart">
          <input
            type="submit"
            className="btn_login btnmyheaderPink"
            onClick="onClickSentColor()"
            // className={toggleClass ? "btnmyheaderPink" : "btnmyheaderBlue"}

            value="כניסה לחשבון קיים"
          />
        </Link>
        <Link to="/login_up">
          <i
            nput
            type="submit"
            clas
            sName="btn_signup btnmyheaderPink"
            value="משתמש חדש הירשם כאן!"
          />
        </Link>
        {/* <p>my color is {backgroundcolor}</p> */}
        <button className="ChangeColor" onClick={onClickChangeColor()}>
          ChangeColor
        </button>
        <BsHeart className="BsHeart" />
        <Link to="/Main" className="LogoPng">
          <img src={PinkLogo} />
        </Link>
        <div className="Search">
          <Search />
        </div>
        <span className="spanCategory">
          {/* <span className="spanCategory">כאן ילקחו קטגוריות מהרשימה בטבלה</span> */}
          <section className="color-10">
            <nav className="cl-effect-10">
              <a href="#" data-hover="קטגוריה">
                <span>קטגוריה</span>
              </a>
              <a href="#" data-hover="קטגוריה">
                <span>קטגוריה</span>
              </a>
              <a href="#" data-hover="קטגוריה">
                <span>קטגוריה</span>
              </a>
              <a href="#" data-hover="קטגוריה">
                <span>קטגוריה</span>
              </a>
              <a href="#" data-hover="קטגוריה">
                <span>קטגוריה</span>
              </a>
            </nav>
          </section>
        </span>
      </Router>
    </div>
  );
}

<Switch>
  <Route exact path="/ShoppingCart">
    <ShoppingCart />
  </Route>
  <Route exact path="/login_up">
    <Loginup />
  </Route>
  <Link to="/shoppingCart">
    <button className="btn btn-1 btn-1a">Button</button>
  </Link>
</Switch>;
export default MyHeader;

function Search() {
  return (
    <div className="container">
      <imput type="text" placeholder="Search" />
      <div className="search"></div>
    </div>

    // <div className="SearchInput">
    //   <input
    //     type="text"
    //     name="term"
    //     id="liveSearch"
    //     className="form-control"
    //     // placeholder="שם מוצר"
    //     autoComplete="off"
    //     data-provide="typeahead"
    //   ></input>
    //   <span className="SearchInput-btn">
    //     <button className="btn btn-blue nontrans">
    //       <span>חפש לי!</span>
    //     </button>
    //   </span>
    // </div>
  );
}
